import React from 'react'
import TemperatureGraph from "./TemperatureGraphic/TemperatureGraph.js"

export default function Info (props){
    const numOfCities = props.data.selectedCities.length
    console.warn("num of cities ===> ", numOfCities)

    if(numOfCities > 2) {
        return (
            <div>
                <TemperatureGraph data={this.props.data}/>
            </div>
        )
    } else {
        return null
    }   
}
